import React, { Component } from 'react'; 
import PlayfulPalette2 from './assets/playfulpalette2.jpg';
import PlayfulPalette from './assets/playfulpalette.jpg';

import SyriaCover from './assets/syriacover.jpg';

class HomeGrid extends Component {

    render() {
        return (
          <div>
            <div class="container">
              <div class="row">
                <div class="col">
                  <img src={PlayfulPalette} alt="Playful Palette thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <img src={SyriaCover} alt="Syria Cover thumbnail" class="cropped"></img>
                </div>
                <div class="col">
                    <div style="padding:52.08% 0 0 0;position:relative;"><iframe src="https://player.vimeo.com/video/230313693?title=0&byline=0&portrait=0" style="position:absolute;top:0;left:0;width:100%;height:100%;" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen></iframe></div><script src="https://player.vimeo.com/api/player.js"></script>                </div>
              </div>
             </div>
          </div>
        ) 
    }
}
export default HomeGrid;
